LatestDate_1.query:
q = load "${Apps.sfdc_internal__AdminAnalytics.Datasets.ApexExecution.Alias}";
q = foreach q generate 'TIMESTAMP_DERIVED_sec_epoch' as 'TIMESTAMP_DERIVED_sec_epoch';
q = order q by 'TIMESTAMP_DERIVED_sec_epoch' desc;
q = limit q 1;

SlowLeaders.query:
q = load "${Apps.sfdc_internal__AdminAnalytics.Datasets.ApexExecution.Alias}";
result = group q by ('QUIDDITY', 'ENTRY_POINT');
result = foreach result generate q.'QUIDDITY' as 'QUIDDITY', q.'ENTRY_POINT' as 'ENTRY_POINT', round(avg(q.'RUN_TIME'),0) as 'A';
result = group result by ('QUIDDITY', 'ENTRY_POINT');
result = foreach result generate 'QUIDDITY', 'ENTRY_POINT', first(A) as 'A', rank() over([..] partition by 'QUIDDITY' order by sum(A) desc) as 'Rank';
result = order result by ('QUIDDITY' asc, 'ENTRY_POINT' asc);
result = filter result by 'Rank'==1;
result = foreach result generate 'QUIDDITY','ENTRY_POINT','A' as 'Avg Time (ms)';
result = order result by 'QUIDDITY' asc;
result = limit result 2000;

YestWorstPerfType_1.query:
