q = filter q by 'TIMESTAMP_DERIVED_sec_epoch'=={{column(LatestDate_1.result, ["TIMESTAMP_DERIVED_sec_epoch"]).asObject()}};
result = group q by ('QUIDDITY', 'ENTRY_POINT');
