result = group result by ('QUIDDITY', 'ENTRY_POINT');
result = foreach result generate 'QUIDDITY', 'ENTRY_POINT', first(A) as 'A', rank() over([..] partition by 'QUIDDITY' order by sum(A) desc) as 'Rank';
